import { useSelector, useDispatch } from "react-redux";
const CStatusModel = () => {
  const mapStateToProps = (state) => {
    return {
      data: state.commentStore.commentModal,
    };
  };
  const state = useSelector(state => state.state)
  return <></>;
};
export default CStatusModel;
